{"operationName":"products","variables":{"productIds":["30047891","30047892","30047759","30045774","30047907","30045776","30047893","30045775","30043456","30045772","30043603"]},"query":"query products($productIds: [String]!) {
  products(productIds: $productIds) {
    productId
    name {
      cyrillic
      latin
      __typename
    }
    rating {
      star
      count
      __typename
    }
    media {
      images {
        key
        urls
        __typename
      }
      __typename
    }
    features {
      main {
        name
        value
        __typename
      }
      energyEfficiency {
        name
        value
        __typename
      }
      __typename
    }
    brand {
      name
      __typename
    }
    categories {
      id
      name
      __typename
    }
    __typename
  }
}
"}
